import './IMA.css';
import Media from 'react-media';
import './IMA.css';

// image Background
export default function REturnIMA() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-bgima-homed'>
  <div className='bgima-homed'></div>
  <img src={'img/straight-talk.jpg'} alt={'alt images head'} />

  <div className='wrp-quote-homed'>
   <ViewHomed />
  </div>

  <div className='wrp-view-head'>
   <ViewTitleMsg />
  </div>
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-bgima-homed-sm'>
  <div className='bgima-homed-sm'></div>
  <img src={'img/straight-talk.jpg'} alt={'alt images head'} />

  <div className='wrp-quote-homed-sm'>
   <ViewHomed />
  </div>

  <div className='wrp-view-head-sm'>
   <ViewTitleMsg />
  </div>
 </div>
);
export const ViewHomed = () => (
 <>
  <h1>Protégez vos actifs</h1>
  <h2>

   <div>
    <span>
     <span style={{ marginRight: '.2em' }}>
      Portefeuilles
    </span>
     <span className='red-ungamamoney'>Muungano</span>
     <span className='yellow-ungamamoney'>Money</span>,
    </span>

    <p>
     conçus selon les normes de sécurité les plus élevées
  </p>
   </div>

  </h2>
 </>
);
export const ViewTitleMsg = () => (
 <p>Fiabilité, Sécurité, rapidité et Sourire</p>
);
